import "./styles/App.css";

function App() {
  const url =
    "https://www.alphavantage.co/query?function=GLOBAL_QUOTE&symbol=IBM&apikey=DWOKDVU20KTLN8D9";

  try {
    fetch(url, {
      json: true,
      headers: { "User-Agent": "request" },
    })
      .then((res) => {
        if (res.status !== 200) {
          console.log("Status:", res.status);
        } else {
          // data is successfully parsed as a JSON object:
          return res.json();
        }
      })
      .then((data) => {
        console.log(data);
      });
  } catch (error) {
    console.log("Error:", error);
  }

  return <div className="App"></div>;
}

export default App;
